      - type: 0xff85
        FontID: 0xbdf0005
        data: "Having a color that is easily identifiable with an application is not a new concept in Domino Templates. For example, it is commonly known that teal is used in the Teamroom template, green in the Discussion template, and tan in the Document Library template. Defining an application color is a way of branding your application but also is a great wayfinding tool to end-users so that they can easily identify the app, whether it is in their view of Workspace or in navigating across document tabs in Notes or Nomad."
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
      - type: 0x00de
        Signature: 0xff85
        Version: 0
      - type: 0x0081
      - type: 0x0083
        PABID: 3
      - type: 0x00dd
        Signature: 0xff85
        Version: 0
      - type: 0xff85
        FontID: 0xbdf0005
        data: "The following is a set of primary colors that can be used as the primary application color for the app you are creating or restyling. This color can be used in the application icon, the title page that represents the application name, buttons, and in the action bars on both views and documents. If you are restyling an application, consider using a color similar to the existing color used today in the app. This will help users to transition into the new styling of the application. "
      - type: 0x00d2
        Color:
          Flags: 0x0001
          rgb: 0x262626
